// import logo from './logo.svg';
import './App.css';
import original from './products/original-cinnamon-roll.jpg';
// import logo from '.logo/logo-01.svg';

import Roll from './Roll.js';

function App() {
  return (
    <div className="App">
      <header>
        <img src={original} alt="a plain cinnamon roll"/>
        <img class="logo" src={original} alt="logo of the bun bun bake shop which is a doodle of a cinammon roll"/>
        <div class="navbar">
          <a class="navbar-products"> PRODUCTS</a>
          <b> &emsp;&nbsp; CART</b>
          <hr/>
          <p>Our hand-made cinnamon rolls</p>
        </div>
      </header>

      <div class="list">
        <Roll 
          imageURL={original} 
          rollName="Original cinammon roll"
          price="2.49" />
      </div>
    </div>
  );
}

export default App;
